import { getAuthStatus } from "../utils/api";

export const MemberPage = ({ history }) => {
  React.useEffect(() => {
    getAuthStatus()
      .then(({ data }) => {
          console.log(data);
      })
      .catch((err) => {
        console.log(err);
        // history.push('/login');
      })  
  })
  return (
    <div>
      <div>Member Page</div>
    </div>
  )
};
